/*
The global object to store and pass data between actions.
*/
const DATA = {
    "lat": "",
    "lon": "",
    "weather_data_url": "",
    "message": ""
}

/*
This is a post-execution function used in GetGeo action.
The function extracts the latitude and longitude from GetGeo action result
and store in DATA object.
*/
function extractLatLong() {
    var location = actions.GetGeo.result.loc.split(",");
    var lat = location[0];
    var lon = location[1];
    DATA["lat"] = lat;
    DATA["lon"] = lon;
}

/*
This is a pre-execution function used in CurrentWeather action.
The function gets `weather_api` value from the configuration object,
fethes `WEATHER_API_KEY` secret from the Vault and constracts a URL
to get weather data.
*/
function constractWeatherDataUrl() {
    var weatherApiDomain = kaholo.execution.configuration.weather_api;
    var lat = DATA["lat"];
    var lon = DATA["lon"];
    kaholo.vault.getValueByKey("WEATHER_API_KEY").then(function(key) {
        DATA["weather_data_url"] = `${weatherApiDomain}?lat=${lat}&lon=${lon}&key=${key}`
    });
}

/*
This is a post-execution function used in CurrentWeather action.
The function gets `city_name` and `temp` values from CurrentWeather action result and
constracts a message: `The temperature in <CITY> is <TEMPERATURE>.`
*/
function constractMessage() {
    var data = actions.GetWeather.result.data[0];
    var city = data["city_name"];
    var temp = data["temp"]
    DATA["message"] = `The temperature in ${city} is ${temp}.`
}
